import React from 'react'
import { Link } from 'react-router-dom';

function Header({ view }) {
    return (
        <div>
            <h1>ITEH CRM 2021</h1>
            <h3>{view}</h3>
            <h3><a>LOGOUT</a></h3>
        </div>
    )
}

export default Header
